import { Link, useRouteError } from "react-router-dom";

const MoviesError = () => {
  const error = useRouteError()


  return (
    <div className="movies-error">
      <h2>Error</h2>
      <p>{ error.message }</p>
      <Link to="/">Back to Homepage</Link>
    </div>
  );
}

export default MoviesError;
